import FormStart from '../modules/containers/FormStart';
import Header from '../modules/containers/Header';
import List from '../modules/containers/List';

import mapFloor1 from '../modules/images/map1.svg'
import mapFloor2 from '../modules/images/map2.svg'


const Main = () => {
  return(
    <div>
      <Header/>
      <Map floor={mapFloor1}/>
      <Map floor={mapFloor2}/>
      <List />
    </div>
  )
}

export default Main;
